import classes from "./AddUser.module.css";
export default function AddUser() {
  return (
    <form>
      <div className={classes.input}>
        <label>Name</label>
        <input type="text" />
      </div>
      <div className={classes.input}>
        <label>Age</label>
        <input type="number" min="0" step="1" />
      </div>
    </form>
  );
}
